    description: "<body>\r\n        <div class=\"jd_description_wrapper jd_clear\"><p>This upload contains the official \"SimCity 4 Buildings as Props Vol 1\" and \"SimCity 4 Buildings as Props Vol 2\" files provided by EA/Maxis.</p>\r\n<p>These files provide all buildings available in the base SimCity 4 game and the ones which were added to SimCity 4 in the Rush Hour Expansion in prop form, for use in lot creation. A third file can be found in the pack called <strong>Maxis DLC Props.dat</strong>, which contains the generic/common props from three of the official Maxis Landmark DLCs (Castleset.dat, Parthenon and Stonehange) and the props from the very ancient Plugin Landmark Props (from version 2.1). The main castle model and prop, the castle wall props, the main Parthenon building and prop and the main Stonehange building and prop are <span style=\"color: #e03e2d;\"><strong>NOT </strong></span>part of this file. This file was compiled to address the commonly listed props as dependencies.</p> </div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_preview\" style=\"\"></div>\r\n        <div class=\"jd_screenshot_zone jd_clear\" style=\"\">\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/sc4buildingsaspropsvol1.jpg\" data-lightbox=\"lightbox14\" data-alt=\"lightboxsc4buildingsaspropsvol1.jpg|sc4buildingsaspropsvol2\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/sc4buildingsaspropsvol1.jpg\" alt=\"sc4buildingsaspropsvol1\" ></a> </span>\r\n            <span class=\"jd_screenshot\"><a href=\"https://www.sc4evermore.com/images/jdownloads/screenshots/sc4buildingsaspropsvol2.jpg\" data-lightbox=\"lightbox14\" data-alt=\"lightboxsc4buildingsaspropsvol1.jpg|sc4buildingsaspropsvol2\" target=\"_blank\"><img class=\"jd_image-left\" src=\"https://www.sc4evermore.com/images/jdownloads/screenshots/thumbnails/sc4buildingsaspropsvol2.jpg\" alt=\"sc4buildingsaspropsvol22\" ></a> </span>\r\n            <span class=\"jd_screenshot\"> </span>\r\n        </div> \r\n</body>"
